TEST(expm_multiply, big_sparse_test)
{
    Eigen::SparseMatrix<double> A{5000, 5000};
    std::vector<Eigen::Triplet<double>> triplets{};
    triplets.reserve(5000);

    for (int i = 0; i < 200; i++) {
        triplets.emplace_back(A_rows[i], A_cols[i], A_values[i]);
    }
    A.setFromTriplets(triplets.begin(), triplets.end());

    Eigen::VectorXd b{5000};
    for (int i = 0; i < 5000; i++) {
        b(i) = b_data[i];
    }

    auto result = *Eigen::expm_multiply(A, b);
    for (int i = 0; i < 5000; i++) {
        ASSERT_NEAR(result(i), res_data[i], 1e-3);
    }
}
